# len(zstring): 30255
import base64, lzma
zstring = base64.b85decode(zstring)
zstring = lzma.decompress(zstring)
jscode = zstring.decode("utf-8")

import execjs
ctx = execjs.compile(jscode)






import re
import json
import requests

def get_info(page):
    def mk_url_headers():
        url = 'http://match.yuanrenxue.com/match/9'
        headers = {
            "accept-encoding": "gzip, deflate", # auto delete br encoding. cos requests and scrapy can not decode it.
            "accept-language": "zh-CN,zh;q=0.9",
            "accept": "text/html,application/xhtml+xml,application/xml;q=0.9,image/webp,image/apng,*/*;q=0.8",
            "user-agent": "yuanrenxue.project"
        }
        return url,headers
    url,headers = mk_url_headers()
    s = requests.get(url,headers=headers)
    m = ctx.call('get_m', re.findall(r"decrypt,'(\d+)'\)", s.text)[0])
    sessionid = re.findall('sessionid=[^;]+;', s.headers['Set-Cookie'])[0]
    def mk_url_headers(page, sessionid, m):
        url = 'http://match.yuanrenxue.com/api/match/9?page={}'.format(page)
        headers = {
            "Host": "match.yuanrenxue.com",
            "Connection": "keep-alive",
            "Accept": "application/json, text/javascript, */*; q=0.01",
            "User-Agent": "yuanrenxue.project",
            "X-Requested-With": "XMLHttpRequest",
            "Referer": "http://match.yuanrenxue.com/match/9",
            "Accept-Encoding": "gzip, deflate", # auto delete br encoding. cos requests and scrapy can not decode it.
            "Accept-Language": "zh-CN,zh;q=0.9",
            "Cookie": (
                sessionid + "m={}".format(m)
            ),
        }
        return url,headers
    url,headers = mk_url_headers(page, sessionid, m)
    s = requests.get(url,headers=headers)
    return json.loads(s.text)

allvalues = []
for page in range(1, 6):
    values = [i['value'] for i in get_info(page)['data']]
    allvalues.extend(values)
    print('page:{} --> values:{}'.format(page, values))

_sum = sum(allvalues)
_len = len(allvalues)
print('平均值：{} (sum:{},len:{})'.format(_sum/_len, _sum, _len))

